  true,\n\t\"url\": null,\n\t\"notes\": \"_Abstract:_  Annual average wind resource
  potential for the state of Georgia at a 50 meter height.rnrn_Purpose:_  Provide
  information on the wind resource development potential within the state of Georgia.rnrn_Supplemental
  Information:_  This data set has been validated by NREL and wind energy meteorological
  consultants. However, the data is not suitable for micro-siting potential development
  projects. This shapefile was generated from a raster dataset with a 200 m resolution,
  in a UTM zone 17, datum WGS 84 projection system.rnrnOther_Citation_Details:  The
  wind power resource estimates were produced by AWS TrueWind using their MesoMap
  system and historical weather data under contract to Wind Powering America/NREL.
